// src/App.js
import React from 'react';
import './App.css';
import TarjetaProyecto from './componentes/TarjetaProyecto';
import TarjetaFuente from './componentes/TarjetaFuente';
import TarjetaPanel from './componentes/TarjetaPanel';
import TarjetaTablero from './componentes/TarjetaTablero';

function App() {
  return (
    <div className="contenedor">
      <h1>Proyectos</h1>
      <div className="tarjetas">
        <TarjetaProyecto />
        <TarjetaFuente />
        <TarjetaPanel />
        <TarjetaTablero />
      </div>
    </div>
  );
}

export default App;
